import arr from "./output";

let my_arr=[];
for (let i = 0; i <3; i++) {
    my_arr+=arr.pop();
}
const News = (props) =>{

  return(
      <div>
          {my_arr.map((value, index) => value)}
      </div>
  )
};
export default News;
